pragma solidity >=0.6.0 <0.8.0;

import './OwnedUpgradeabilityProxy.sol';

contract EtherForwardOwnedUpgradeabilityProxy is OwnedUpgradeabilityProxy {
  address payable private etherForwardAddress;

  receive() external override payable {
    etherForwardAddress.transfer(msg.value);
  }

  function getEtherForwardAddress() public view returns (address) {
    return etherForwardAddress;
  }

  function setEtherForwardAddress(address ethForwardAddr) public onlyProxyOwner {
    etherForwardAddress = payable(ethForwardAddr);
  }
}
